import React from "react";
import { useNavigate } from "react-router-dom";

function Card({ title, city, rate, desc, schedule, startDate }) {
  const navigate = useNavigate();

  const staffGig = async () => {
    // TODO adds user as the provider to the selected gig
    await navigate("/MyGigs");
  };
  return (
    <div>
      {title}
      {city}
      {rate}
      {desc}
      {schedule}
      {startDate}
      <button onClick={staffGig}>Staff Gig</button>
    </div>
  );
}

export default Card;
